// SPDX-License-Identifier: MIT
pragma solidity <0.9.0 >=0.7.0;


import "./token/IERC20.sol";

import "./uniswap/IUniswapV2Factory.sol";
import "./uniswap/IUniswapV2Router02.sol";
import "./uniswap/IUniswapV2Pair.sol";

import "./chainlink/AggregatorV3Interface.sol";


// Kovan network

contract HelloDex {

    address constant private uniswapV2FactoryAddress = 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f;

    address constant private uniswapV2Router02Address = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;

    address constant private uniswapV2PairAddress = 0x92FacdfB69427CffC1395a7e424AeA91622035Fc;

    address constant private oracleDAIETHPriceFeedAddress = 0x22B58f1EbEDfCA50feF632bD73368b2FdA96D541;

    address constant private daiAddress = 0xFf795577d9AC8bD7D90Ee22b6C1703490b6512FD;

    address immutable private owner;

    IUniswapV2Factory immutable internal factory;

    IUniswapV2Router02 immutable internal router;

    IUniswapV2Pair immutable internal pair;

    AggregatorV3Interface immutable internal priceOracle;

    IERC20 immutable private dai;

    event Swapped(address indexed token, uint256 indexed price, uint indexed amount);

    event PriceReceived(int indexed price, uint80 roundId, uint startedAt,uint timeStamp, uint80 answeredInRound);

    constructor() {
        owner = msg.sender;
        factory = IUniswapV2Factory(uniswapV2FactoryAddress);
        router = IUniswapV2Router02(uniswapV2Router02Address);
        pair = IUniswapV2Pair(uniswapV2PairAddress);
        priceOracle = AggregatorV3Interface(oracleDAIETHPriceFeedAddress);
        dai = IERC20(daiAddress);
    }

    modifier onlyOwner(){
        require(msg.sender == owner, "!owner");
        _;
    }

    function swapDaiForEth(uint256 _amountInEth) external onlyOwner {

        // 1. Get Price
        uint256 daiPriceInEth =  uint256(_getLatestPrice());
        uint amountOfDaiToRequestInEth = daiPriceInEth * _amountInEth;

        uint256 currentDaiBalanceOfSender = dai.balanceOf(msg.sender);
        require(currentDaiBalanceOfSender >= amountOfDaiToRequestInEth, ">dai");

        // 2. HelloDex needs to own DAI
        require(dai.transferFrom(msg.sender, address(this), amountOfDaiToRequestInEth), "!transferFrom");

        // 3. Approve Uniswap Router to Withdraw
        require(dai.approve(uniswapV2Router02Address, amountOfDaiToRequestInEth), "!approved");

        // 4. Now ready to swap with DAI/WETH
        address[] memory pathVars =new address[](2);
        pathVars[0] = daiAddress;
        pathVars[1] = router.WETH();
        uint deadlineOfNowPlus30Seconds = block.timestamp + 30 seconds;
        router.swapExactTokensForETH(
            amountOfDaiToRequestInEth, 
            amountOfDaiToRequestInEth, 
            pathVars, 
            msg.sender, 
            deadlineOfNowPlus30Seconds);
        emit Swapped(daiAddress, daiPriceInEth,  amountOfDaiToRequestInEth);
    }

    function _getLatestPrice() internal view returns (int) {
        (,int price,,,) = priceOracle.latestRoundData();
        return price;
    }
}
